use crate::prelude::*;
use reqwest::Url;

pub mod bot;

#[derive(Deserialize)]
pub struct SearchResponse {
    pub listings: Vec<SearchListing>,
}

#[derive(Deserialize)]
pub struct SearchListing {
    #[serde(rename = "itemId")]
    pub item_id: String,

    pub title: String,

    pub description: String,

    #[serde(rename = "date")]
    pub timestamp: DateTime<Local>,

    #[serde(default, rename = "imageUrls")]
    pub image_urls: Vec<String>,

    #[serde(rename = "priceInfo")]
    pub price: PriceInfo,

    #[serde(rename = "priorityProduct")]
    pub priority_product: PriorityProduct,

    #[serde(rename = "vipUrl")]
    pub url: String,
}

#[derive(Deserialize)]
pub struct PriceInfo {
    #[serde(rename = "priceCents")]
    pub cents: i32,

    #[serde(rename = "priceType")]
    pub type_: PriceType,
}

#[derive(Deserialize)]
pub enum PriceType {
    #[serde(rename = "FIXED")]
    Fixed,

    #[serde(rename = "ON_REQUEST")]
    OnRequest,

    #[serde(rename = "MIN_BID")]
    MinBid,

    #[serde(rename = "SEE_DESCRIPTION")]
    SeeDescription,

    #[serde(rename = "NOTK")]
    ToBeAgreed,

    #[serde(rename = "RESERVED")]
    Reserved,
}

#[derive(Deserialize)]
pub enum PriorityProduct {
    #[serde(rename = "NONE")]
    None,

    #[serde(rename = "DAGTOPPER")]
    DayTopper,
}

/// Search Marktplaats.
pub async fn search(query: &str) -> Result<SearchResponse> {
    info!("Searching `{}`…", query);
    Ok(CLIENT.get(Url::parse_with_params("https://www.marktplaats.nl/lrp/api/search?limit=30&offset=0&sortBy=SORT_INDEX&sortOrder=DECREASING", &[("query", query)])?).send().await?.json().await?)
}

